      SELECT ALL + col0 * + tab0.col2 + col0 * + col2 FROM tab0 (FORMAT parquet) WHERE NOT - tab0.col2 - - col2 * col2 IN ( col1 * tab0.col0 - col1 );
  - name: tab0

outputs:
